import "./Navbar.css";
import DictionaryProps from "../../data/constants/DictionaryProps";
import React from "react";
import { useTranslation } from "react-i18next";
import LoginControl from "./controls/LoginControl";

import ThemeControl from "./controls/ThemeControl";
import LanguageControl from "./controls/LanguageControl";
import CSSProps from "../../data/constants/CSSProps";
import AppSettings from "../../data/AppSettings";
import { Base } from "../Base";
import NavItem from "./controls/NavItem";
import VolumeControl from "./controls/VolumeControl";
import {
  BrowserRouter as Router
} from "react-router-dom";
const Navbar = () => {
  const [t] = useTranslation(AppSettings.TranslationFilename);
  
  return (

    <Router>
      <nav className={CSSProps.NavBar.Bar}>
      <ul className={CSSProps.NavBar.Navigation}>
        <NavItem path={"/about"} text={t(DictionaryProps.Home)} onClickPageID={CSSProps.ID.Home} iconID={CSSProps.ID.Home}/>
        <ThemeControl/>
        <NavItem path={"/about"} text={t(DictionaryProps.Servicedesk)} onClickPageID={CSSProps.ID.ServiceDesk} iconID={CSSProps.ID.ServiceDesk}/>
        <LanguageControl/>
        <NavItem path="/about" text={t(DictionaryProps.About)} onClickPageID={CSSProps.ID.About} iconID={CSSProps.ID.About}/>
        <VolumeControl/>
        <LoginControl onClick={()=>Base.prototype.SwitchPage(CSSProps.ID.Login)}/>
      </ul>
    </nav>
    </Router>
  );
};

export default Navbar;
